import {
  FILE_UPLOAD_REQUEST,
  FILE_UPLOAD_SUCCESS,
  FILE_UPLOAD_FAIL,
  FILE_UPLOAD_RESET,
} from "../constants/fileConstant";

const API = process.env.REACT_APP_API;

export const fileUpload = ({ fileUpload }) => async (dispatch) => {
  try {
    console.log(fileUpload);
    dispatch({ type: FILE_UPLOAD_REQUEST });
    const response = await fetch(`${API}/file_upload`, {
      body: fileUpload,
      method: "POST",
      headers: { "Content-Type": "application/json" },
    });
    dispatch({
      type: FILE_UPLOAD_SUCCESS,
      payload: response.json(),
    });
  } catch (error) {
    dispatch({
      type: FILE_UPLOAD_FAIL,
      payload:
        error.response && error.response.data.msg
          ? error.respone.data.msg
          : error,
    });
  }
};

export const sayHi = () => async (dispatch) => {
  try {
    console.log("calling data");

    // const { data } = axios
    //   .get({ url: `${API}/say_hi` })
    //   .then((res) => res.data);
    const data = await fetch(`${API}/say_hi`)
      .then((response) => response.json())
      .then((data) => console.log(data));

    if (data) {
      console.log(data);
    }
  } catch (e) {
    console.log(e.message);
  }
};
